import React from 'react';
import { Card } from 'react-bootstrap';

export default function Receipt(props) {

    const { order } = props;
    console.log(order);
    let body = <Card.Body>
        <Card.Text></Card.Text>
    </Card.Body>;

    let date = new Date(order.Date);
    let dateString =  date.getMonth() + '/' + date.getDate() + '/' + date.getFullYear();

    return(
        <Card>
            <Card.Body>
                <Card.Title>{order.CustomerName}<br/>Receipt ID: {order.OrderId}<br/>Date: {new Date(order.Date)}</Card.Title>
                <Card.Text></Card.Text>
            </Card.Body>
        </Card>
    );
}
